import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { ThromboseRenale } from 'src/app/models/ThromboseRenale';
import { ThrenaleService } from 'src/app/services/threnale.service';

@Component({
  selector: 'app-threnale',
  templateUrl: './threnale.component.html',
  styleUrls: ['./threnale.component.css']
})
export class ThrenaleComponent {
  complications: ThromboseRenale[] = [new ThromboseRenale()];
  errorMessage: string = '';

  constructor(private ThrenaleService: ThrenaleService) {}

  addComplication() {
    this.complications.push(new ThromboseRenale());
  }

  onSubmit() {
    for (let complication of this.complications) {
      this.ThrenaleService.addrenale(complication).subscribe(
        response => {
          console.log('Complication added successfully', response);
          this.errorMessage = '';
        },
        (error: HttpErrorResponse) => {
          console.error('Error adding Complication', error);
          this.errorMessage = error.error.title;
          if (error.error.errors) {
            for (const [field, errors] of Object.entries(error.error.errors)) {
              console.error(`Validation error for ${field}:`, errors);
            }
          }
        }
      );
    }
  }
}
